import React from "react";
import vue from "./components/api/vue.";

function djam() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <p>hello world</p>
    </div>
  );
}

export default djam;
